/*Table structure for table `fan_power` */

DROP TABLE IF EXISTS `fan_power`;

CREATE TABLE `fan_power` (
  `fid` int(11) DEFAULT NULL COMMENT '粉丝id',
  `comment` varchar(600) DEFAULT NULL COMMENT '粉丝评论内容',
  `liketote` int(11) DEFAULT NULL COMMENT '评论内容点赞数',
  `commtote` int(11) DEFAULT NULL COMMENT '评论内容评论数',
  `transtoto` int(11) DEFAULT NULL COMMENT '评论内容转发数',
  KEY `fid` (`fid`),
  CONSTRAINT `fan_power_ibfk_1` FOREIGN KEY (`fid`) REFERENCES `fan_homepage` (`fid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fan_power` */

/*Table structure for table `fan_region` */

DROP TABLE IF EXISTS `fan_region`;

CREATE TABLE `fan_region` (
  `province` varchar(100) DEFAULT NULL COMMENT '粉丝所在省',
  `tote` int(11) DEFAULT NULL COMMENT '省份中粉丝数量'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

